(1, '(2019 TM6)', '20.454', '456.75982899855 meters', '2019-Nov-07', '02:07', '85571.3470090838 km/h', '60233100.721313931 km', '1573092420000', 'Earth', '4', '2019-11-05 06:05:27', '2019-10-07', '2019-11-04', '28 days', '28', '8', '.0572476', '3.361', '2458772.5', '.610515843384391', '2.229078308521197', '7.884400312333236', '317.9598242764671', '1215.588031507224', '.8681906850245268', '160.0473416988347', '3.589965932017868', '2458832.259557943961', '342.3020297154858', '.2961529652061736', 'J2000', 'APO', 'Near-Earth asteroid orbits which cross the Earthâ€™s orbit similar to that of 1862 Apollo', 'a (semi-major axis) > 1.0 AU; q (perihelion) < 1.017 AU', 'False', 'This asteroid poses no threat to planet Earth!');
INSERT INTO `asteroid_implications` (`Asteroid_name`, `Atmospheric Entry`, `Energy`, `Global Damages`, `Crater`, `Ejecta`, `Thermal Radiation`, `Seismic Effects`, `Air Blast`, `Tsunami`) VALUES
('', '11885 Summanus (1990 SS)', '\r\n\r\nEnergy before atmospheric entry: 4.49 x 10^19 Joules = 1.07 x 10^4 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 2.2 x 10^5 years\r\n', '\r\nThe Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.', 'Transient Crater Diameter: 6.57 km ( = 4.08 miles )\r\nTransient Crater Depth: 2.32 km ( = 1.44 miles )\r\nFinal Crater Diameter: 8.44 km ( = 5.24 miles )\r\nFinal Crater Depth: 562 meters ( = 1840 feet )\r\nThe crater formed is a complex crater.\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.', 'Almost no solid ejecta reaches this site.', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.\r\n\r\n', 'The major seismic shaking will arrive approximately 18.8 minutes after impact.\r\nRichter Scale Magnitude:  7.3\r\nMercalli Scale Intensity at a distance of 5638 km:\r\n\r\nNothing would be felt.  However, seismic equipment may still detect shaking.', 'The air blast will arrive approximately 4.75 hours after impact.\r\nPeak Overpressure: 212 Pa = 0.00212 bars = 0.03 psi\r\nMax wind velocity: 0.498 m/s = 1.11 mph\r\nSound Intensity: 47 dB (Easily Heard)', NULL),
('(2000 AF205)', '\r\nThe projectile begins to breakup at an altitude of 73700 meters = 242000 ft\r\nThe projectile reaches the ground in a broken condition.  The mass of projectile strikes the surface at velocity 6.27 km/s = 3.89 miles/s\r\nThe impact energy is 1.75 x 10^17 Joules = 4.19 x 10^1 MegaTons.\r\nThe broken projectile fragments strike the ground in an ellipse of dimension 1.46 km by 1.03 km\r\n', '\r\n\r\nEnergy before atmospheric entry: 5.4 x 10^17 Joules = 1.29 x 10^2 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 3 x 10^4 years\r\n', '\r\nThe Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.\r\n', '\r\nCrater shape is normal in spite of atmospheric crushing; fragments are not significantly dispersed.\r\nTransient Crater Diameter: 1.64 km ( = 1.02 miles )\r\nTransient Crater Depth: 580 meters ( = 1900 feet )\r\nFinal Crater Diameter: 2.05 km ( = 1.27 miles )\r\nFinal Crater Depth: 437 meters ( = 1430 feet )\r\nThe crater formed is a simple crater.\r\nThe floor of the crater is underlain by a lens of broken rock debris (breccia) with a maximum thickness of 202 meters ( = 664 feet ).\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.\r\n', '\r\nAlmost no solid ejecta reaches this site.\r\n', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.\r\n\r\n', '\r\nThe major seismic shaking will arrive approximately 2.96 minutes after impact.\r\nRichter Scale Magnitude:  5.7\r\nMercalli Scale Intensity at a distance of 888 km:\r\n\r\nNothing would be felt.  However, seismic equipment may still detect shaking.\r\n\r\n\r\n', '\r\nThe air blast will arrive approximately 44.8 minutes after impact.\r\nPeak Overpressure: 215 Pa = 0.00215 bars = 0.0305 psi\r\nMax wind velocity: 0.505 m/s = 1.13 mph\r\nSound Intensity: 47 dB (Easily Heard)\r\n\r\n', NULL),
('(2000 UY33)', '\r\nThe projectile begins to breakup at an altitude of 73700 meters = 242000 ft\r\nThe projectile reaches the ground in a broken condition.  The mass of projectile strikes the surface at velocity 3.23 km/s = 2.01 miles/s\r\nThe impact energy is 2.04 x 10^16 Joules = 4.87 MegaTons.\r\nThe broken projectile fragments strike the ground in an ellipse of dimension 1.44 km by 1.02 km\r\n', '\r\n\r\nEnergy before atmospheric entry: 2.36 x 10^17 Joules = 5.63 x 10^1 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 1.4 x 10^4 years\r\n', '\r\nThe Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.\r\n', '\r\nThe result of the impact is a crater field, not a single crater. The following dimensions are for the crater produced by the largest fragment.\r\nTransient Crater Diameter: 494 meters ( = 1620 feet )\r\nTransient Crater Depth: 175 meters ( = 573 feet )\r\nFinal Crater Diameter: 618 meters ( = 2030 feet )\r\nFinal Crater Depth: 132 meters ( = 431 feet )\r\nThe crater formed is a simple crater.\r\nThe floor of the crater is underlain by a lens of broken rock debris (breccia) with a maximum thickness of 61 meters ( = 200 feet ).\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.\r\n', '\r\nMost ejecta is blocked by Earth\'s atmosphere.\r\n', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.\r\n\r\n', '\r\nThe major seismic shaking will arrive approximately 2.63 minutes after impact.\r\nRichter Scale Magnitude:  5.1\r\nMercalli Scale Intensity at a distance of 789 km:\r\n\r\nNothing would be felt.  However, seismic equipment may still detect shaking.\r\n\r\n\r\n', '\r\nThe air blast will arrive approximately 39.8 minutes after impact.\r\nPeak Overpressure: 117 Pa = 0.00117 bars = 0.0166 psi\r\nMax wind velocity: 0.276 m/s = 0.618 mph\r\nSound Intensity: 41 dB (Easily Heard)\r\n\r\n', NULL),
('(2002 LT38)', 'The projectile begins to breakup at an altitude of 47100 meters = 154000 ft\r\nThe projectile reaches the ground in a broken condition.  The mass of projectile strikes the surface at velocity 10.8 km/s = 6.7 miles/s\r\nThe impact energy is 1.08 x 10^19 Joules = 2.58 x 10^3 MegaTons.\r\nThe broken projectile fragments strike the ground in an ellipse of dimension 1.05 km by 0.739 km', 'Energy before atmospheric entry: 1.12 x 10^19 Joules = 2.68 x 10^3 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 1.3 x 10^5 years\r\n', 'The Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.', '\r\nCrater shape is normal in spite of atmospheric crushing; fragments are not significantly dispersed.\r\nTransient Crater Diameter: 4.97 km ( = 3.09 miles )\r\nTransient Crater Depth: 1.76 km ( = 1.09 miles )\r\nFinal Crater Diameter: 6.16 km ( = 3.82 miles )\r\nFinal Crater Depth: 511 meters ( = 1680 feet )\r\nThe crater formed is a complex crater.\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.\r\n', '\r\nAlmost no solid ejecta reaches this site.', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.', 'The major seismic shaking will arrive approximately 10.1 minutes after impact.\r\nRichter Scale Magnitude:  6.9\r\nMercalli Scale Intensity at a distance of 3020 km:\r\n\r\nNothing would be felt.  However, seismic equipment may still detect shaking.', '\r\nThe air blast will arrive approximately 2.54 hours after impact.\r\nPeak Overpressure: 250 Pa = 0.0025 bars = 0.0354 psi\r\nMax wind velocity: 0.588 m/s = 1.31 mph\r\nSound Intensity: 48 dB (Easily Heard)\r\n', NULL),
('(2004 BG41)', '\r\nThe projectile begins to breakup at an altitude of 65500 meters = 215000 ft\r\nThe projectile bursts into a cloud of fragments at an altitude of 7170 meters = 23500 ft.\r\nThe residual velocity of the projectile fragments after the burst is 2.38 km/s = 1.48 miles/s.\r\nThe energy of the airburst is 1.85 x 10^16 Joules = 4.42 x 10^0 MegaTons.\r\nNo crater is formed, although large fragments may strike the surface.\r\n', '\r\n\r\nEnergy before atmospheric entry: 1.94 x 10^16 Joules = 4.64 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 1.4 x 10^3 years\r\n', NULL, NULL, NULL, NULL, NULL, '\r\nThe air blast will arrive approximately 2.55 hours after impact.\r\nPeak Overpressure: 58.9 Pa = 0.000589 bars = 0.00836 psi\r\nMax wind velocity: 0.139 m/s = 0.31 mph\r\nSound Intensity: 35 dB (Easily Heard)\r\n\r\n', NULL),
('(2005 LX36)', '\r\nThe projectile begins to breakup at an altitude of 47100 meters = 154000 ft\r\nThe projectile reaches the ground in a broken condition.  The mass of projectile strikes the surface at velocity 10.7 km/s = 6.64 miles/s\r\nThe impact energy is 5.3 x 10^18 Joules = 1.27 x 10^3 MegaTons.\r\nThe broken projectile fragments strike the ground in an ellipse of dimension 0.957 km by 0.677 km', '\r\n\r\nEnergy before atmospheric entry: 5.61 x 10^18 Joules = 1.34 x 10^3 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 1 x 10^5 years\r\n', '\r\nThe Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.', '\r\nCrater shape is normal in spite of atmospheric crushing; fragments are not significantly dispersed.\r\nTransient Crater Diameter: 4.13 km ( = 2.57 miles )\r\nTransient Crater Depth: 1.46 km ( = 0.908 miles )\r\nFinal Crater Diameter: 5 km ( = 3.11 miles )\r\nFinal Crater Depth: 480 meters ( = 1580 feet )\r\nThe crater formed is a complex crater.\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.\r\n', '\r\nThe ejecta will arrive approximately 7.18 minutes after the impact.\r\nAt your position there is a fine dusting of ejecta with occasional larger fragments.\r\nAverage Ejecta Thickness: 5.31 microns ( = 0.209 thousandths of an inch )\r\nMean Fragment Diameter: 130 microns ( = 5.11 thousandths of an inch )\r\n', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.\r\n\r\n', '\r\nThe major seismic shaking will arrive approximately 2.63 minutes after impact.\r\nRichter Scale Magnitude:  6.7\r\nMercalli Scale Intensity at a distance of 789 km:\r\n\r\nNothing would be felt.  However, seismic equipment may still detect shaking.\r\n\r\n\r\n', '\r\nThe air blast will arrive approximately 39.8 minutes after impact.\r\nPeak Overpressure: 779 Pa = 0.00779 bars = 0.111 psi\r\nMax wind velocity: 1.83 m/s = 4.1 mph\r\nSound Intensity: 58 dB (Loud as heavy traffic)\r\n\r\n', NULL),
('(2005 VK1)', '\r\nThe projectile begins to breakup at an altitude of 47100 meters = 154000 ft\r\nThe projectile reaches the ground in a broken condition.  The mass of projectile strikes the surface at velocity 8.98 km/s = 5.57 miles/s\r\nThe impact energy is 3.11 x 10^17 Joules = 7.43 x 10^1 MegaTons.\r\nThe broken projectile fragments strike the ground in an ellipse of dimension 0.819 km by 0.579 km\r\n', '\r\n\r\nEnergy before atmospheric entry: 4.67 x 10^17 Joules = 1.12 x 10^2 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 2.6 x 10^4 years\r\n', '\r\nThe Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.\r\n', '\r\nCrater shape is normal in spite of atmospheric crushing; fragments are not significantly dispersed.\r\nTransient Crater Diameter: 2.01 km ( = 1.25 miles )\r\nTransient Crater Depth: 709 meters ( = 2330 feet )\r\nFinal Crater Diameter: 2.51 km ( = 1.56 miles )\r\nFinal Crater Depth: 534 meters ( = 1750 feet )\r\nThe crater formed is a simple crater.\r\nThe floor of the crater is underlain by a lens of broken rock debris (breccia) with a maximum thickness of 247 meters ( = 811 feet ).\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.\r\n', '\r\nAlmost no solid ejecta reaches this site.\r\n', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.\r\n\r\n', '\r\nThe major seismic shaking will arrive approximately 3.33 minutes after impact.\r\nRichter Scale Magnitude:  5.9\r\nMercalli Scale Intensity at a distance of 998 km:\r\n\r\nNothing would be felt.  However, seismic equipment may still detect shaking.\r\n\r\n\r\n', '\r\nThe air blast will arrive approximately 50.4 minutes after impact.\r\nPeak Overpressure: 231 Pa = 0.00231 bars = 0.0328 psi\r\nMax wind velocity: 0.545 m/s = 1.22 mph\r\nSound Intensity: 47 dB (Easily Heard)\r\n\r\n', NULL),
('(2005 WD)', '\r\nThe projectile begins to breakup at an altitude of 7170 meters = 23500 ft\r\nThe projectile reaches the ground in a broken condition.  The mass of projectile strikes the surface at velocity 10.9 km/s = 6.77 miles/s\r\nThe impact energy is 3.21 x 10^18 Joules = 7.68 x 10^2 MegaTons.\r\nThe broken projectile fragments strike the ground in an ellipse of dimension 0.379 km by 0.268 km\r\n', '\r\n\r\nEnergy before atmospheric entry: 3.28 x 10^18 Joules = 7.83 x 10^2 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 8.4 x 10^4 years\r\n', '\r\nThe Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.\r\n', '\r\nCrater shape is normal in spite of atmospheric crushing; fragments are not significantly dispersed.\r\nTransient Crater Diameter: 3.89 km ( = 2.42 miles )\r\nTransient Crater Depth: 1.38 km ( = 0.855 miles )\r\nFinal Crater Diameter: 4.67 km ( = 2.9 miles )\r\nFinal Crater Depth: 471 meters ( = 1540 feet )\r\nThe crater formed is a complex crater.\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.\r\n', '\r\nAlmost no solid ejecta reaches this site.\r\n', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.\r\n\r\n', '\r\nThe major seismic shaking will arrive approximately 30.3 minutes after impact.\r\nRichter Scale Magnitude:  6.5\r\nMercalli Scale Intensity at a distance of 9090 km:\r\n\r\nNothing would be felt.  However, seismic equipment may still detect shaking.\r\n\r\n\r\n', '\r\nThe air blast will arrive approximately 7.65 hours after impact.\r\nPeak Overpressure: 54.9 Pa = 0.000549 bars = 0.00779 psi\r\nMax wind velocity: 0.129 m/s = 0.289 mph\r\nSound Intensity