('(2006 SC)', '\r\nThe projectile begins to breakup at an altitude of 47100 meters = 154000 ft\r\nThe projectile bursts into a cloud of fragments at an altitude of 5930 meters = 19500 ft.\r\nThe residual velocity of the projectile fragments after the burst is 3.35 km/s = 2.08 miles/s.\r\nThe energy of the airburst is 1.34 x 10^16 Joules = 3.2 x 10^0 MegaTons.\r\nNo crater is formed, although large fragments may strike the surface.\r\n', '\r\n\r\nEnergy before atmospheric entry: 1.48 x 10^16 Joules = 3.53 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 1.1 x 10^3 years\r\n', '', '', '', '', '', '\r\nThe air blast will arrive approximately 44.9 minutes after impact.\r\nPeak Overpressure: 176 Pa = 0.00176 bars = 0.0249 psi\r\nMax wind velocity: 0.414 m/s = 0.925 mph\r\nSound Intensity: 45 dB (Easily Heard)\r\n\r\n', NULL),
