('(2009 DR36)', '\r\nThe projectile begins to breakup at an altitude of 65500 meters = 215000 ft\r\nThe projectile reaches the ground in a broken condition.  The mass of projectile strikes the surface at velocity 10.3 km/s = 6.39 miles/s\r\nThe impact energy is 3.72 x 10^18 Joules = 8.89 x 10^2 MegaTons.\r\nThe broken projectile fragments strike the ground in an ellipse of dimension 1.31 km by 0.927 km\r\n', '\r\n\r\nEnergy before atmospheric entry: 4.25 x 10^18 Joules = 1.02 x 10^3 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 9.3 x 10^4 years\r\n', '\r\nThe Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.\r\n', '\r\nCrater shape is normal in spite of atmospheric crushing; fragments are not significantly dispersed.\r\nTransient Crater Diameter: 3.59 km ( = 2.23 miles )\r\nTransient Crater Depth: 1.27 km ( = 0.789 miles )\r\nFinal Crater Diameter: 4.27 km ( = 2.65 miles )\r\nFinal Crater Depth: 458 meters ( = 1500 feet )\r\nThe crater formed is a complex crater.\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.\r\n', '\r\nThe ejecta will arrive approximately 7.12 minutes after the impact.\r\nAt your position there is a fine dusting of ejecta with occasional larger fragments.\r\nAverage Ejecta Thickness: 3.18 microns ( = 0.125 thousandths of an inch )\r\nMean Fragment Diameter: 115 microns ( = 4.52 thousandths of an inch )\r\n', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.\r\n\r\n', '\r\nThe major seismic shaking will arrive approximately 2.59 minutes after impact.\r\nRichter Scale Magnitude:  6.6\r\nMercalli Scale Intensity at a distance of 777 km:\r\n\r\nNothing would be felt.  However, seismic equipment may still detect shaking.\r\n\r\n\r\n', '\r\nThe air blast will arrive approximately 39.2 minutes after impact.\r\nPeak Overpressure: 699 Pa = 0.00699 bars = 0.0993 psi\r\nMax wind velocity: 1.64 m/s = 3.68 mph\r\nSound Intensity: 57 dB (Loud as heavy traffic)\r\n\r\n', NULL),
('(2009 UC)', '\r\nThe projectile begins to breakup at an altitude of 47100 meters = 154000 ft\r\nThe projectile bursts into a cloud of fragments at an altitude of 15800 meters = 51900 ft.\r\nThe residual velocity of the projectile fragments after the burst is 5.7 km/s = 3.54 miles/s.\r\nThe energy of the airburst is 1.36 x 10^15 Joules = 0.32 x 10^0 MegaTons.\r\nNo crater is formed, although large fragments may strike the surface.', '\r\nEnergy before atmospheric entry: 1.86 x 10^15 Joules = 444.16 KiloTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth is 156.5 years', NULL, NULL, NULL, NULL, NULL, '\r\nThe air blast at this location would not be noticed. (The overpressure is less than 1 Pa)\r\n\r\n', NULL),
('(2009 WD)', '\r\nThe projectile begins to breakup at an altitude of 47100 meters = 154000 ft\r\nThe projectile reaches the ground in a broken condition.  The mass of projectile strikes the surface at velocity 10.8 km/s = 6.69 miles/s\r\nThe impact energy is 9.37 x 10^18 Joules = 2.24 x 10^3 MegaTons.\r\nThe broken projectile fragments strike the ground in an ellipse of dimension 1.03 km by 0.725 km\r\n', '\r\n\r\nEnergy before atmospheric entry: 9.76 x 10^18 Joules = 2.33 x 10^3 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 1.3 x 10^5 years\r\n', '\r\nThe Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.\r\n', '\r\nCrater shape is normal in spite of atmospheric crushing; fragments are not significantly dispersed.\r\nTransient Crater Diameter: 4.79 km ( = 2.98 miles )\r\nTransient Crater Depth: 1.69 km ( = 1.05 miles )\r\nFinal Crater Diameter: 5.91 km ( = 3.67 miles )\r\nFinal Crater Depth: 505 meters ( = 1660 feet )\r\nThe crater formed is a complex crater.\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.\r\n', '\r\nThe ejecta will arrive approximately 7.13 minutes after the impact.\r\nAt your position there is a fine dusting of ejecta with occasional larger fragments.\r\nAverage Ejecta Thickness: 9.99 microns ( = 0.394 thousandths of an inch )\r\nMean Fragment Diameter: 160 microns ( = 6.3 thousandths of an inch )\r\n', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.\r\n\r\n', '\r\nThe major seismic shaking will arrive approximately 2.59 minutes after impact.\r\nRichter Scale Magnitude:  6.8\r\nMercalli Scale Intensity at a distance of 778 km:\r\n\r\nNothing would be felt.  However, seismic equipment may still detect shaking.\r\n\r\n\r\n', '\r\nThe air blast will arrive approximately 39.3 minutes after impact.\r\nPeak Overpressure: 968 Pa = 0.00968 bars = 0.138 psi\r\nMax wind velocity: 2.27 m/s = 5.08 mph\r\nSound Intensity: 60 dB (Loud as heavy traffic)\r\n\r\n', NULL),
