('(2015 AJ44)', '\r\nThe projectile begins to breakup at an altitude of 73700 meters = 242000 ft\r\nThe projectile reaches the ground in a broken condition.  The mass of projectile strikes the surface at velocity 3.23 km/s = 2.01 miles/s\r\nThe impact energy is 2.04 x 10^16 Joules = 4.87 MegaTons.\r\nThe broken projectile fragments strike the ground in an ellipse of dimension 1.44 km by 1.02 km', '\r\n\r\nEnergy before atmospheric entry: 2.36 x 10^17 Joules = 5.63 x 10^1 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 1.4 x 10^4 years', '\r\nThe Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.', '\r\nThe result of the impact is a crater field, not a single crater. The following dimensions are for the crater produced by the largest fragment.\r\nTransient Crater Diameter: 494 meters ( = 1620 feet )\r\nTransient Crater Depth: 175 meters ( = 573 feet )\r\nFinal Crater Diameter: 618 meters ( = 2030 feet )\r\nFinal Crater Depth: 132 meters ( = 431 feet )\r\nThe crater formed is a simple crater.\r\nThe floor of the crater is underlain by a lens of broken rock debris (breccia) with a maximum thickness of 61 meters ( = 200 feet ).\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.\r\n', '\r\nMost ejecta is blocked by Earth\'s atmosphere.\r\n', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.\r\n', '\r\nThe major seismic shaking will arrive approximately 3.19 minutes after impact.\r\nRichter Scale Magnitude:  5.1\r\nMercalli Scale Intensity at a distance of 957 km:\r\n\r\nNothing would be felt.  However, seismic equipment may still detect shaking.\r\n', '\r\nThe air blast will arrive approximately 48.3 minutes after impact.\r\nPeak Overpressure: 96.6 Pa = 0.000966 bars = 0.0137 psi\r\nMax wind velocity: 0.228 m/s = 0.509 mph\r\nSound Intensity: 40 dB (Easily Heard)', NULL),
('(2015 MO66)', '\r\nThe projectile begins to breakup at an altitude of 7200 meters = 23600 ft\r\nThe projectile reaches the ground in a broken condition.  The mass of projectile strikes the surface at velocity 11 km/s = 6.8 miles/s\r\nThe impact energy is 3.4 x 10^19 Joules = 8.13 x 10^3 MegaTons.\r\nThe broken projectile fragments strike the ground in an ellipse of dimension 0.749 km by 0.53 km\r\n', '\r\n\r\nEnergy before atmospheric entry: 3.43 x 10^19 Joules = 8.19 x 10^3 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 2 x 10^5 years\r\n', '\r\nThe Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.\r\n', '\r\nCrater shape is normal in spite of atmospheric crushing; fragments are not significantly dispersed.\r\nTransient Crater Diameter: 7.19 km ( = 4.46 miles )\r\nTransient Crater Depth: 2.54 km ( = 1.58 miles )\r\nFinal Crater Diameter: 9.34 km ( = 5.8 miles )\r\nFinal Crater Depth: 580 meters ( = 1900 feet )\r\nThe crater formed is a complex crater.\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.\r\n', '\r\nAlmost no solid ejecta reaches this site.\r\n', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.\r\n\r\n', '\r\nThe major seismic shaking will arrive approximately 25.3 minutes after impact.\r\nRichter Scale Magnitude:  7.2\r\nMercalli Scale Intensity at a distance of 7586 km:\r\n\r\nNothing would be felt.  However, seismic equipment may still detect shaking.\r\n\r\n\r\n', '\r\nThe air blast will arrive approximately 6.39 hours after impact.\r\nPeak Overpressure: 145 Pa = 0.00145 bars = 0.0206 psi\r\nMax wind velocity: 0.341 m/s = 0.763 mph\r\nSound Intensity: 43 dB (Easily Heard)\r\n\r\n', NULL),
