('(2015 TX144)', '\r\nThe projectile begins to breakup at an altitude of 6330 meters = 20800 ft\r\nThe projectile bursts into a cloud of fragments at an altitude of 198 meters = 649 ft.\r\nThe residual velocity of the projectile fragments after the burst is 2.93 km/s = 1.82 miles/s.\r\nThe energy of the airburst is 1.01 x 10^15 Joules = 0.24 x 10^0 MegaTons.\r\nLarge fragments strike the surface and may create a crater strewn field.  A more careful treatment of atmospheric entry is required to accurately estimate the size-frequency distribution of meteoroid fragments and predict the number and size of craters formed.', 'Energy before atmospheric entry: 1.08 x 10^15 Joules = 259.12 KiloTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth is 95 years', NULL, NULL, NULL, NULL, NULL, '\r\nThe air blast will arrive approximately 2.13 hours after impact.\r\nPeak Overpressure: 14.6 Pa = 0.000146 bars = 0.00208 psi\r\nMax wind velocity: 0.0345 m/s = 0.0771 mph\r\nSound Intensity: 23 dB (Easily Heard)', NULL),
