('(2018 RU3)', '\r\nThe projectile begins to breakup at an altitude of 47100 meters = 154000 ft\r\nThe projectile reaches the ground in a broken condition.  The mass of projectile strikes the surface at velocity 7.87 km/s = 4.89 miles/s\r\nThe impact energy is 1.37 x 10^17 Joules = 3.28 x 10^1 MegaTons.\r\nThe broken projectile fragments strike the ground in an ellipse of dimension 0.808 km by 0.571 km\r\n', '\r\n\r\nEnergy before atmospheric entry: 2.69 x 10^17 Joules = 6.42 x 10^1 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 1.6 x 10^4 years\r\n', '\r\nThe Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.\r\n', '\r\nCrater shape is normal in spite of atmospheric crushing; fragments are not significantly dispersed.\r\nTransient Crater Diameter: 1.64 km ( = 1.02 miles )\r\nTransient Crater Depth: 580 meters ( = 1900 feet )\r\nFinal Crater Diameter: 2.05 km ( = 1.27 miles )\r\nFinal Crater Depth: 436 meters ( = 1430 feet )\r\nThe crater formed is a simple crater.\r\nThe floor of the crater is underlain by a lens of broken rock debris (breccia) with a maximum thickness of 202 meters ( = 663 feet ).\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.\r\n', '\r\nAlmost no solid ejecta reaches this site.\r\n', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.\r\n\r\n', '\r\nThe major seismic shaking will arrive approximately 19 minutes after impact.\r\nRichter Scale Magnitude:  5.6\r\nMercalli Scale Intensity at a distance of 5698 km:\r\n\r\nNothing would be felt.  However, seismic equipment may still detect shaking.\r\n\r\n\r\n', '\r\nThe air blast will arrive approximately 4.8 hours after impact.\r\nPeak Overpressure: 30.6 Pa = 0.000306 bars = 0.00434 psi\r\nMax wind velocity: 0.0721 m/s = 0.161 mph\r\nSound Intensity: 30 dB (Easily Heard)\r\n\r\n', NULL),
('(2018 VB10)', '\r\nThe projectile begins to breakup at an altitude of 73700 meters = 242000 ft\r\nThe projectile bursts into a cloud of fragments at an altitude of 20600 meters = 67400 ft.\r\nThe residual velocity of the projectile fragments after the burst is 4.87 km/s = 3.03 miles/s.\r\nThe energy of the airburst is 1.5 x 10^15 Joules = 0.36 x 10^0 MegaTons.\r\nNo crater is formed, although large fragments may strike the surface.\r\n', '\r\n\r\nEnergy before atmospheric entry: 1.87 x 10^15 Joules = 447.11 KiloTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth is 157.5 years\r\n', NULL, NULL, NULL, NULL, NULL, '\r\nThe air blast at this location would not be noticed. (The overpressure is less than 1 Pa)\r\n\r\n', NULL),
('(2019 AC3)', '\r\nThe projectile begins to breakup at an altitude of 47100 meters = 154000 ft\r\nThe projectile bursts into a cloud of fragments at an altitude of 20100 meters = 66000 ft.\r\nThe residual velocity of the projectile fragments after the burst is 6.61 km/s = 4.1 miles/s.\r\nThe energy of the airburst is 4.52 x 10^14 Joules = 0.11 x 10^0 MegaTons.\r\nNo crater is formed, although large fragments may strike the surface.\r\n', '\r\n\r\nEnergy before atmospheric entry: 7.07 x 10^14 Joules = 168.86 KiloTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth is 63.9 years\r\n', '', '', '', '', '', '\r\nThe air blast will arrive approximately 44.7 minutes after impact.\r\nPeak Overpressure: 3.67 Pa = 3.67E-05 bars = 0.000521 psi\r\nMax wind velocity: 0.00864 m/s = 0.0193 mph\r\nSound Intensity: 11 dB (Barely Audible)\r\n\r\n', NULL),
('(2019 GP19)', '\r\nThe projectile begins to breakup at an altitude of 73700 meters = 242000 ft\r\nThe projectile bursts into a cloud of fragments at an altitude of 26400 meters = 86600 ft.\r\nThe residual velocity of the projectile fragments after the burst is 6.23 km/s = 3.87 miles/s.\r\nThe energy of the airburst is 4.05 x 10^14 Joules = 0.97 x 10^-1 MegaTons.\r\nNo crater is formed, although large fragments may strike the surface.\r\n', '', '', '', '', '', '', '\r\n\r\nEnergy before atmospheric entry: 5.96 x 10^14 Joules = 142.44 KiloTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth is 54.6 years\r\n', NULL),
('(2019 GX3)', '\r\nThe projectile begins to breakup at an altitude of 47100 meters = 154000 ft\r\nThe projectile bursts into a cloud of fragments at an altitude of 22000 meters = 72100 ft.\r\nThe residual velocity of the projectile fragments after the burst is 6.96 km/s = 4.32 miles/s.\r\nThe energy of the airburst is 2.75 x 10^14 Joules = 0.66 x 10^-1 MegaTons.\r\nNo crater is formed, although large fragments may strike the surface.\r\n', '\r\n\r\nEnergy before atmospheric entry: 4.58 x 10^14 Joules = 109.43 KiloTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth is 42.8 years\r\n', NULL, NULL, NULL, NULL, NULL, '\r\nThe air blast will arrive approximately 44.8 minutes after impact.\r\nPeak Overpressure: 4.78 Pa = 4.78E-05 bars = 0.000679 psi\r\nMax wind velocity: 0.0113 m/s = 0.0252 mph\r\nSound Intensity: 14 dB (Barely Audible)\r\n\r\n', NULL),
('(2019 HK4)', '\r\nThe projectile begins to breakup at an altitude of 47100 meters = 154000 ft\r\nThe projectile reaches the ground in a broken condition.  The mass of projectile strikes the surface at velocity 10.5 km/s = 6.55 miles/s\r\nThe impact energy is 2.91 x 10^18 Joules = 6.96 x 10^2 MegaTons.\r\nThe broken projectile fragments strike the ground in an ellipse of dimension 0.906 km by 0.64 km\r\n', '\r\n\r\nEnergy before atmospheric entry: 3.17 x 10^18 Joules = 7.58 x 10^2 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 8.3 x 10^4 years\r\n', '\r\nThe Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.\r\n', '\r\nCrater shape is normal in spite of atmospheric crushing; fragments are not significantly dispersed.\r\nTransient Crater Diameter: 3.54 km ( = 2.2 miles )\r\nTransient Crater Depth: 1.25 km ( = 0.778 miles )\r\nFinal Crater Diameter: 4.2 km ( = 2.61 miles )\r\nFinal Crater Depth: 456 meters ( = 1500 feet )\r\nThe crater formed is a complex crater.\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.\r\n', '\r\nAlmost no solid ejecta reaches this site.\r\n', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.\r\n\r\n', '\r\nThe major seismic shaking will arrive approximately 20.3 minutes after impact.\r\nRichter Scale Magnitude:  6.5\r\nMercalli Scale Intensity at a distance of 6080 km:\r\n\r\nNothing would be felt.  However, seismic equipment may still detect shaking.\r\n\r\n\r\n', '\r\nThe air blast will arrive approximately 5.12 hours after impact.\r\nPeak Overpressure: 79.5 Pa = 0.000795 bars = 0.0113 psi\r\nMax wind velocity: 0.187 m/s = 0.419 mph\r\nSound Intensity: 38 dB (Easily Heard)\r\n\r\n', NULL),
