('(2019 KA3)', '\r\nThe projectile begins to breakup at an altitude of 6190 meters = 20300 ft\r\nThe projectile bursts into a cloud of fragments at an altitude of 687 meters = 2250 ft.\r\nThe residual velocity of the projectile fragments after the burst is 2.99 km/s = 1.86 miles/s.\r\nThe energy of the airburst is 7.01 x 10^14 Joules = 0.17 x 10^0 MegaTons.\r\nLarge fragments strike the surface and may create a crater strewn field.  A more careful treatment of atmospheric entry is required to accurately estimate the size-frequency distribution of meteoroid fragments and predict the number and size of craters formed.\r\n', '\r\n\r\nEnergy before atmospheric entry: 7.57 x 10^14 Joules = 180.93 KiloTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth is 68.1 years\r\n', NULL, NULL, NULL, NULL, NULL, '\r\nThe air blast will arrive approximately 39.8 minutes after impact.\r\nPeak Overpressure: 49.7 Pa = 0.000497 bars = 0.00705 psi\r\nMax wind velocity: 0.117 m/s = 0.262 mph\r\nSound Intensity: 34 dB (Easily Heard)\r\n\r\n', NULL),
