INSERT INTO `asteroid_implications` (`Asteroid_name`, `Atmospheric Entry`, `Energy`, `Global Damages`, `Crater`, `Ejecta`, `Thermal Radiation`, `Seismic Effects`, `Air Blast`, `Tsunami`) VALUES
('(2019 RA2)', '\r\nThe projectile begins to breakup at an altitude of 7080 meters = 23200 ft\r\nThe projectile reaches the ground in a broken condition.  The mass of projectile strikes the surface at velocity 10.6 km/s = 6.59 miles/s\r\nThe impact energy is 1.53 x 10^17 Joules = 3.65 x 10^1 MegaTons.\r\nThe broken projectile fragments strike the ground in an ellipse of dimension 0.218 km by 0.154 km\r\n', '\r\n\r\nEnergy before atmospheric entry: 1.64 x 10^17 Joules = 3.92 x 10^1 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 9.9 x 10^3 years\r\n', '\r\nThe Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.\r\n', '\r\nCrater shape is normal in spite of atmospheric crushing; fragments are not significantly dispersed.\r\nTransient Crater Diameter: 1.77 km ( = 1.1 miles )\r\nTransient Crater Depth: 625 meters ( = 2050 feet )\r\nFinal Crater Diameter: 2.21 km ( = 1.37 miles )\r\nFinal Crater Depth: 470 meters ( = 1540 feet )\r\nThe crater formed is a simple crater.\r\nThe floor of the crater is underlain by a lens of broken rock debris (breccia) with a maximum thickness of 218 meters ( = 715 feet ).\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.\r\n', '\r\nAlmost no solid ejecta reaches this site.\r\n', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.\r\n\r\n', '\r\nThe major seismic shaking will arrive approximately 3.3 minutes after impact.\r\nRichter Scale Magnitude:  5.6\r\nMercalli Scale Intensity at a distance of 989 km:\r\n\r\nNothing would be felt.  However, seismic equipment may still detect shaking.\r\n\r\n\r\n', '\r\nThe air blast will arrive approximately 49.9 minutes after impact.\r\nPeak Overpressure: 184 Pa = 0.00184 bars = 0.0261 psi\r\nMax wind velocity: 0.433 m/s = 0.968 mph\r\nSound Intensity: 45 dB (Easily Heard)\r\n\r\n', NULL),
('(2019 RD)', '\r\nThe projectile begins to breakup at an altitude of 7210 meters = 23700 ft\r\nThe projectile reaches the ground in a broken condition.  The mass of projectile strikes the surface at velocity 11 km/s = 6.81 miles/s\r\nThe impact energy is 9.18 x 10^19 Joules = 2.19 x 10^4 MegaTons.\r\nThe broken projectile fragments strike the ground in an ellipse of dimension 1.03 km by 0.726 km\r\n', '\r\n\r\nEnergy before atmospheric entry: 9.24 x 10^19 Joules = 2.21 x 10^4 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 2.9 x 10^5 years\r\n', '\r\nThe Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.\r\n', '\r\nCrater shape is normal in spite of atmospheric crushing; fragments are not significantly dispersed.\r\nTransient Crater Diameter: 9.31 km ( = 5.78 miles )\r\nTransient Crater Depth: 3.29 km ( = 2.04 miles )\r\nFinal Crater Diameter: 12.5 km ( = 7.77 miles )\r\nFinal Crater Depth: 633 meters ( = 2080 feet )\r\nThe crater formed is a complex crater.\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.\r\n', '\r\nThe ejecta will arrive approximately 6.07 minutes after the impact.\r\nAt your position there is a fine dusting of ejecta with occasional larger fragments.\r\nAverage Ejecta Thickness: 334 microns ( = 13.2 thousandths of an inch )\r\nMean Fragment Diameter: 737 microns ( = 29 thousandths of an inch )\r\n', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.\r\n\r\n', '\r\nThe major seismic shaking will arrive approximately 1.95 minutes after impact.\r\nRichter Scale Magnitude:  7.5\r\nMercalli Scale Intensity at a distance of 585 km:\r\n\r\nFelt quite noticeably by persons indoors, especially on upper floors of buildings.  Many people do not recognize it as an earthquake.  Standing motor cars may rock slightly.  Vibrations similar to the passing of a truck.\r\n\r\nFelt indoors by many, outdoors by few during the day.  At night, some awakened.  Dishes, windows, doors disturbed; walls make cracking sound.  Sensation like heavy truck striking building.  Standing motor cars rocked noticeably.\r\n\r\n', '\r\nThe air blast will arrive approximately 29.5 minutes after impact.\r\nPeak Overpressure: 3200 Pa = 0.032 bars = 0.455 psi\r\nMax wind velocity: 7.44 m/s = 16.7 mph\r\nSound Intensity: 70 dB (Loud as heavy traffic)\r\n\r\n', NULL),
