tes after impact.\r\nPeak Overpressure: 255 Pa = 0.00255 bars = 0.0362 psi\r\nMax wind velocity: 0.6 m/s = 1.34 mph\r\nSound Intensity: 48 dB (Easily Heard)\r\n\r\n', NULL),
