('(2019 UJ9)', '\r\nThe projectile begins to breakup at an altitude of 65500 meters = 215000 ft\r\nThe projectile bursts into a cloud of fragments at an altitude of 8730 meters = 28600 ft.\r\nThe residual velocity of the projectile fragments after the burst is 2.74 km/s = 1.7 miles/s.\r\nThe energy of the airburst is 1.35 x 10^16 Joules = 3.22 x 10^0 MegaTons.\r\nNo crater is formed, although large fragments may strike the surface.', '\r\n\r\nEnergy before atmospheric entry: 1.44 x 10^16 Joules = 3.43 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 1 x 10^3 years', NULL, NULL, NULL, NULL, NULL, '\r\nThe air blast at this location would not be noticed. (The overpressure is less than 1 Pa)\r\n', NULL),
('(2019 UL4)', '\r\nThe projectile begins to breakup at an altitude of 65500 meters = 215000 ft\r\nThe projectile bursts into a cloud of fragments at an altitude of 13900 meters = 45600 ft.\r\nThe residual velocity of the projectile fragments after the burst is 4.01 km/s = 2.49 miles/s.\r\nThe energy of the airburst is 4.57 x 10^15 Joules = 1.09 x 10^0 MegaTons.\r\nNo crater is formed, although large fragments may strike the surface.', '\r\nEnergy before atmospheric entry: 5.27 x 10^15 Joules = 1.26 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth is 410.8 years', NULL, NULL, NULL, NULL, NULL, 'The air blast at this location would not be noticed. (The overpressure is less than 1 Pa)', NULL),
('(2019 UL6)', 'The projectile begins to breakup at an altitude of 6990 meters = 22900 ft\r\nThe projectile reaches the ground in a broken condition.  The mass of projectile strikes the surface at velocity 10.2 km/s = 6.3 miles/s\r\nThe impact energy is 3.75 x 10^16 Joules = 8.95 MegaTons.\r\nThe broken projectile fragments strike the ground in an ellipse of dimension 0.196 km by 0.138 km', '\r\nEnergy before atmospheric entry: 4.4 x 10^16 Joules = 1.05 x 10^1 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 2.9 x 10^3 years', 'The Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.', 'Crater shape is normal in spite of atmospheric crushing; fragments are not significantly dispersed.\r\nTransient Crater Diameter: 1.23 km ( = 0.764 miles )\r\nTransient Crater Depth: 435 meters ( = 1430 feet )\r\nFinal Crater Diameter: 1.54 km ( = 0.956 miles )\r\nFinal Crater Depth: 328 meters ( = 1070 feet )\r\nThe crater formed is a simple crater.\r\nThe floor of the crater is underlain by a lens of broken rock debris (breccia) with a maximum thickness of 152 meters ( = 498 feet ).\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.', 'Most ejecta is blocked by Earth\'s atmosphere.', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.', 'The major seismic shaking will arrive approximately 13.5 minutes after impact.\r\nRichter Scale Magnitude:  5.2\r\nMercalli Scale Intensity at a distance of 4040 km:\r\n\r\nNothing would be felt.  However, seismic equipment may still detect shaking.', '\r\nThe air blast will arrive approximately 3.4 hours after impact.\r\nPeak Overpressure: 28 Pa = 0.00028 bars = 0.00397 psi\r\nMax wind velocity: 0.0659 m/s = 0.147 mph\r\nSound Intensity: 29 dB (Easily Heard)', NULL),
('(2019 UM12)', '\r\nThe projectile begins to breakup at an altitude of 65500 meters = 215000 ft\r\nThe projectile bursts into a cloud of fragments at an altitude of 8910 meters = 29200 ft.\r\nThe residual velocity of the projectile fragments after the burst is 2.79 km/s = 1.73 miles/s.\r\nThe energy of the airburst is 1.3 x 10^16 Joules = 3.1 x 10^0 MegaTons.\r\nNo crater is formed, although large fragments may strike the surface.\r\n', '\r\n\r\nEnergy before atmospheric entry: 1.39 x 10^16 Joules = 3.31 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 1 x 10^3 years', NULL, NULL, NULL, NULL, NULL, '\r\nThe air blast at this location would not be noticed. (The overpressure is less than 1 Pa)', NULL),
('(2019 UN2)', 'The crater entered the atmosphere intact', '\r\n\r\nEnergy before atmospheric entry: 7.77 x 10^15 Joules = 1.86 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth is 588.4 years', NULL, NULL, NULL, NULL, NULL, '\r\nThe air blast at this location would not be noticed. (The overpressure is less than 1 Pa)\r\n\r\n', NULL),
('(2019 UO11)', '\r\nThe projectile begins to breakup at an altitude of 7200 meters = 23600 ft\r\nThe projectile reaches the ground in a broken condition.  The mass of projectile strikes the surface at velocity 10.9 km/s = 6.79 miles/s\r\nThe impact energy is 1.68 x 10^19 Joules = 4.01 x 10^3 MegaTons.\r\nThe broken projectile fragments strike the ground in an ellipse of dimension 0.603 km by 0.426 km\r\n', '\r\n\r\nEnergy before atmospheric entry: 1.7 x 10^19 Joules = 4.05 x 10^3 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 1.6 x 10^5 years\r\n', '\r\nThe Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.\r\n', '\r\nCrater shape is normal in spite of atmospheric crushing; fragments are not significantly dispersed.\r\nTransient Crater Diameter: 5.98 km ( = 3.72 miles )\r\nTransient Crater Depth: 2.12 km ( = 1.31 miles )\r\nFinal Crater Diameter: 7.59 km ( = 4.72 miles )\r\nFinal Crater Depth: 545 meters ( = 1790 feet )\r\nThe crater formed is a complex crater.\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.\r\n', '\r\nAlmost no solid ejecta reaches this site.\r\n', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.\r\n\r\n', '\r\nThe major seismic shaking will arrive approximately 30.3 minutes after impact.\r\nRichter Scale Magnitude:  7\r\nMercalli Scale Intensity at a distance of 9090 km:\r\n\r\nNothing would be felt.  However, seismic equipment may still detect shaking.\r\n\r\n\r\n', '\r\nThe air blast will arrive approximately 7.65 hours after impact.\r\nPeak Overpressure: 95.3 Pa = 0.000953 bars = 0.0135 psi\r\nMax wind velocity: 0.225 m/s = 0.502 mph\r\nSound Intensity: 40 dB (Easily Heard)\r\n\r\n', NULL),
