 (Easily Heard)\r\n\r\n', NULL),
('162082 (1998 HL1)', '\r\nThe projectile begins to breakup at an altitude of 7210 meters = 23700 ft\r\nThe projectile reaches the ground in a broken condition.  The mass of projectile strikes the surface at velocity 11 km/s = 6.82 miles/s\r\nThe impact energy is 2.06 x 10^20 Joules = 4.92 x 10^4 MegaTons.\r\nThe broken projectile fragments strike the ground in an ellipse of dimension 1.33 km by 0.943 km\r\n', '\r\n\r\nEnergy before atmospheric entry: 2.07 x 10^20 Joules = 4.94 x 10^4 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 4.5 x 10^5 years\r\n', '\r\nThe Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.\r\n', '\r\nCrater shape is normal in spite of atmospheric crushing; fragments are not significantly dispersed.\r\nTransient Crater Diameter: 11.5 km ( = 7.13 miles )\r\nTransient Crater Depth: 4.06 km ( = 2.52 miles )\r\nFinal Crater Diameter: 15.9 km ( = 9.85 miles )\r\nFinal Crater Depth: 680 meters ( = 2230 feet )\r\nThe crater formed is a complex crater.\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.\r\n', '\r\nThe ejecta will arrive approximately 7.69 minutes after the impact.\r\nAt your position there is a fine dusting of ejecta with occasional larger fragments.\r\nAverage Ejecta Thickness: 221 microns ( = 8.69 thousandths of an inch )\r\nMean Fragment Diameter: 310 microns ( = 12.2 thousandths of an inch )\r\n', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.\r\n\r\n', '\r\nThe major seismic shaking will arrive approximately 2.96 minutes after impact.\r\nRichter Scale Magnitude:  7.7\r\nMercalli Scale Intensity at a distance of 889 km:\r\n\r\nNot felt except by a very few under especially favorable conditions.\r\n\r\nFelt only by a few persons at rest, especially on upper floors of buildings.\r\n\r\n\r\n', '\r\nThe air blast will arrive approximately 44.9 minutes after impact.\r\nPeak Overpressure: 2670 Pa = 0.0267 bars = 0.378 psi\r\nMax wind velocity: 6.21 m/s = 13.9 mph\r\nSound Intensity: 69 dB (Loud as heavy traffic)\r\n\r\n', NULL);
