('164211 (2004 JA27)', '\r\nThe projectile begins to breakup at an altitude of 47100 meters = 154000 ft\r\nThe projectile reaches the ground in a broken condition.  The mass of projectile strikes the surface at velocity 10.9 km/s = 6.77 miles/s\r\nThe impact energy is 3.81 x 10^19 Joules = 9.1 x 10^3 MegaTons.\r\nThe broken projectile fragments strike the ground in an ellipse of dimension 1.31 km by 0.926 km\r\n', '\r\n\r\nEnergy before atmospheric entry: 3.88 x 10^19 Joules = 9.28 x 10^3 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 2.1 x 10^5 years\r\n', '\r\nThe Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.\r\n', '\r\nCrater shape is normal in spite of atmospheric crushing; fragments are not significantly dispersed.\r\nTransient Crater Diameter: 6.89 km ( = 4.28 miles )\r\nTransient Crater Depth: 2.44 km ( = 1.51 miles )\r\nFinal Crater Diameter: 8.91 km ( = 5.53 miles )\r\nFinal Crater Depth: 572 meters ( = 1880 feet )\r\nThe crater formed is a complex crater.\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.\r\n', '\r\nThe ejecta will arrive approximately 8.24 minutes after the impact.\r\nAt your position there is a fine dusting of ejecta with occasional larger fragments.\r\nAverage Ejecta Thickness: 20.2 microns ( = 0.797 thousandths of an inch )\r\nMean Fragment Diameter: 126 microns ( = 4.96 thousandths of an inch )\r\n', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.\r\n\r\n', '\r\nThe major seismic shaking will arrive approximately 3.33 minutes after impact.\r\nRichter Scale Magnitude:  7.2\r\nMercalli Scale Intensity at a distance of 999 km:\r\n\r\nNot felt except by a very few under especially favorable conditions.\r\n\r\nFelt only by a few persons at rest, especially on upper floors of buildings.', '\r\nThe air blast will arrive approximately 50.5 minutes after impact.\r\nPeak Overpressure: 1230 Pa = 0.0123 bars = 0.174 psi\r\nMax wind velocity: 2.87 m/s = 6.43 mph\r\nSound Intensity: 62 dB (Loud as heavy traffic)\r\n\r\n', NULL),
